import requests
from bs4 import BeautifulSoup
import base64
import re

url = 'https://www.bing.com/news/search?q=%20global'

headers = {"Accept-Language": "en,en;q=0.8","user-agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/80.0.3987.132 Safari/537.36"}

response = requests.get(url,headers=headers)
soup = BeautifulSoup(response.text,"html.parser")

with open('result.txt','w', encoding="utf-8") as f:
    f.write(soup.prettify())
print("done")

